void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    vec2 uv = fragCoord / iResolution.xy * (4.0 + iTime / 14.0) * cos(iTime/14.0);

    uv.x *= iResolution.x / iResolution.y;

    uv.x -= 1.5;

    float d = sin(pow(smoothstep(0.0, 0.4, abs(length(fract(uv * length(uv-2.0))-0.5)-0.3)), 0.8) * iTime * 10.0) * iTime;

    fragColor = vec4(d, d, d, 1);
}
